function reportVideoProgress(sskyVideoElement, currentTime, duration) {
  //The below 'currentProgressPct' calc will be refactored in PLAYER-910
  var currentProgressPct = Math.floor(currentTime / duration * 100);

  if (sskyVideoElement._.lastReportedProgress !== currentProgressPct) {
    if (currentProgressPct > 100 || currentProgressPct < 0 || isNaN(currentProgressPct)) {// do nothing - todo - reverse this condition
    } else {
      reportingService.report(consts.REPORT_CATEGORY.VIDEO, "Player Progress", currentProgressPct, 0);

      sskyVideoElement._.trigger("progress", {
        position: currentProgressPct / 100.0
      });

      sskyVideoElement._.lastReportedProgress = currentProgressPct;
    }
  }

  return currentProgressPct;
}

